import React from 'react'

export const Nav = ({allTitleVideo}) => {

  
    return (
        <header>
            <i className="far fa-play-circle"></i>
            <h2>MyTube</h2>

            <label htmlFor="rentrer votre vide">Choose a flavor:</label>
            <input type='text' list="search-video" id="search-video" name="rentrer votre video" />
          
            <datalist id="search-video">
                {allTitleVideo}
            </datalist>
            
            
        </header>
    )
}


export default Nav
